import React from 'react';
import Idea from './Idea';
import IdeaCard from './IdeaCard';

const IdeaList = ({ideas, deleteIdea, editIdea}) => {

  return (
    <div>
      {ideas.map((idea) => {
        return(
        <div>
        <Idea />

        <IdeaCard           
          key={idea.id} 
          idea={idea} 
          deleteIdea={deleteIdea} 
          editIdea={editIdea} 
          />
        </div>



        // />

        );
      })}
    </div>
  );
};

export default IdeaList;
